 told moses to come forth but he tripped on a banana peel and came fifth','Religious',18088,'Pesky Banana Peels'),('Whoever said nothing is impossible has never tried slamming a revolving door.','One Liners',18091,'Impossible'),('Yo mamma is so fat she walked into the GAP and filled it.','Yo Momma',18092,'Gap'),('How many feminists does it take to screw in a lightbulb? Sixteen. One to screw it in and fifteen to form a support group.','Lightbulb',18093,'Feminists'),('What is the difference between Tiger Woods and Santa Claus? Santa only has three Ho\'s.','Insults',18094,'Tiger Woods'),('I saw on the news a little boy being carried up to the sky. I got scared cause I thought Michael Jackson was ordering take-out from Heaven.','Other / Misc',18095,'M.J.'),('Santa Claus, a Boy Scout, and a smart blonde jump out of a plane. Who lands first? The Boy Scout, because the other two don\'t exist.','Blond',18104,'Plane'),('How many Dominicans does it take to screw in a lightbulb? Two. Dominican one to hold the bulb and Dominican two to turn Dominican one','Lightbulb',18106,'How Many Dominicans?'),('Teacher: Billy, tell me the periodic for water.Billy:Okay. H-I-J-K-L-M-N-O.Teacher: What makes you say that? Billy: You said it was H to O.','Children',18107,'H to O'),('What do you get if you cross a dinosaur, a tiger, a crocodile, a spider, and a elephant?  I don\'t know but you better get out of it\'s way!','Animal',18108,'What Do You Get...'),('What happens to you if you can not read? Well, since you\'ll probably be staying in Kindergarten, less homework!','Children',18109,'If You Don\'t Know How to Read, Find Another Joke.'),('Basketball hoops are like misdemeanor. The more I miss it da meanor I get.','Sports',18113,'Basketball Hoops and Misdemeanor'),('Why did the 12 watt lightbulb drop out of school? It wasn\'t very bright.','Lightbulb',18115,'So Long Light Bulb!'),('Register lots of accounts, with each account voting for it as least comedy. If its average comedy drops below 0.5, it will be automatically deleted.','Tech',18117,'How to Ruin a Joke on Wocka'),('What is it called when your pet snake doesn\'t feel right? -reptile dysfunction.','Animal',18121,'Snake Under the Weather?'),('what\'s the difference between here and there? The letter T!','Other / Misc',18125,'Directions'),('A gay pornstar doesn\'t take as many balls to the face as my 4 year old son playing soccer.','One Liners',18126,'Soccer Analogy'),('One day I was standing in the park wondering how frisbees get bigger when they get closer. Then it hit me.','One Liners',18127,'Frisbee'),('Mary had a little lamb, fries and a coke.','One Liners',18128,'A Finger Lickin\' Funny.'),('Mik: \"Do skunks have a good sense of smell? \"Mak: \"No! If they did, they\'d jump off a cliff!\"','Animal',18131,'Ewww! (Mik And Mak from Bad News are Back!)'),('Why didn\'t Megan Fox run from the man-eating lion? Because she was a woman.','Animal',18133,'Lion'),('I don\'t know much about prison, but it sounds like a pain in the ass.','One Liners',18137,'Prison'),('Yo momma so old she rode a limosarus to her wedding!','Yo Momma',18140,'SO OLD!'),('\"Mom! Deaf kids at school are making fun of me.\"\"What did they say?\"','One Liners',18143,'Mom!'),('Why was the diver angry at the diving board? Because it flipped him off.','Insults',18146,'The Angry Diver'),('The word \'function\' should never function as a verb.','One Liners',18148,'Functions'),('I bet you I could stop gambling.','One Liners',18153,'Problem?'),('Why did the computer get sick? He left his windows open','Tech',18167,'BRRRR....'),('My Dad is great at raising kids, if he can remember which are his.','Men / Women',18169,'Dads'),('Yo mommas so fat that when she got on the scale, it read one at a time please.','Yo Momma',18171,'This is Majorly Funny!'),('What do you call a blind German? A not see!','Animal',18172,'The Blind German'),('What did the dog say to the driver who was driving behind him? Get off my tail!','Puns',18178,'Tail'),('Man says to his girlfriendYou\'re the only woman on this planet I want. Oh by the way, I\'m taken a trip to Mars next week.','Other / Misc',18179,'Only One On This Planet'),('What is a 4 letter sport that starts with a T? Golf','Sports',18181,'What Sport?'),('Do you know what the secret of an islamic marriage is? The man get\'s to see a striptease every night!','Other / Misc',18182,'The Secret of an Islamic Marriage'),('Band Class is the only class where you can blow it.','Puns',18184,'Failing Band Class');
